import {Component} from 'react'

class CardContainer extends Component{

    render(){
        const {Image, Name, Email} = this.props;
        return(
            <div key={id}>
                   image = {image}
                   name = {name}
                   email = {email}

                </div>
        )
    }
}

export default CardContainer;
